// Predict using a single tree
inline double predictTree(const TreeNode* tree, const std::vector<double>& features) {
    int node = 0;
    while (tree[node].feature != -1) {
        int feat_idx = tree[node].feature;
        if (feat_idx >= 0 && feat_idx < static_cast<int>(features.size())) {
            if (features[feat_idx] <= tree[node].threshold) {
                node = tree[node].left;
            } else {
                node = tree[node].right;
            }
        } else {
            // Invalid feature index - go to left child
            node = tree[node].left;
        }
    }
    return tree[node].value;
}

// Sequential prediction
inline double predictSequential(const std::vector<double>& features) {
    double pred = BASE_SCORE;
    for (int t = 0; t < N_TREES; ++t) {
        pred += predictTree(TREES[t], features);
    }
    return pred;
}

// Parallel prediction across trees (using RDKit threading)
inline double predictParallel(const std::vector<double>& features, int numThreads = 0) {
    unsigned int nThreads = getNumThreadsToUse(numThreads);
    
    // For small tree counts, sequential is faster
    if (nThreads <= 1 || N_TREES < 50) {
        return predictSequential(features);
    }
    
    // Parallel sum of tree predictions
    std::vector<std::future<double>> futures;
    int treesPerThread = N_TREES / nThreads;
    int remainder = N_TREES % nThreads;
    
    int start = 0;
    for (unsigned int t = 0; t < nThreads; ++t) {
        int count = treesPerThread + (t < remainder ? 1 : 0);
        int end = start + count;
        
        futures.emplace_back(std::async(std::launch::async,
            [&features, start, end]() {
                double sum = 0.0;
                for (int i = start; i < end; ++i) {
                    sum += predictTree(TREES[i], features);
                }
                return sum;
            }));
        start = end;
    }
    
    // Collect results
    double pred = BASE_SCORE;
    for (auto& f : futures) {
        pred += f.get();
    }
    return pred;
}

class FlashpointV2Predictor {
public:
    FlashpointV2Predictor();
    ~FlashpointV2Predictor();
    
    /**
     * Check if molecule is too large/complex (will cause processing to hang)
     * @param mol RDKit molecule
     * @return true if molecule should be skipped (too many rings or heavy atoms)
     */
    static bool isMoleculeTooLarge(const RDKit::ROMol* mol);
    
    /**
     * Predict Flashpoint for a single molecule
     * @param mol RDKit molecule (can be nullptr if SMILES parsing failed)
     * @return Predicted value, or NaN if mol is nullptr or too large
     */
    double predict(const RDKit::ROMol* mol, int numThreads = 0) const;
    
    /**
     * Predict Flashpoint for multiple molecules (PARALLEL)
     * Uses RDKit threading for feature extraction
     * @param mols Vector of molecules (nullptr entries return NaN)
     * @param results Output vector (NaN for failed molecules)
     * @param numThreads Number of threads (0 = auto-detect)
     */
    void predictBatch(
        const std::vector<const RDKit::ROMol*>& mols,
        std::vector<double>& results,
        int numThreads = 0
    ) const;
    
    /**
     * Predict from SMILES string (handles parsing failures)
     * @param smiles SMILES string
     * @return Predicted value, or NaN if SMILES is invalid
     */
    double predictFromSMILES(const std::string& smiles, int numThreads = 0) const;
    
    /**
     * Predict from SMILES strings (PARALLEL, handles failures)
     * @param smiles_list Vector of SMILES strings
     * @param results Output vector (NaN for invalid SMILES)
     * @param numThreads Number of threads (0 = auto-detect)
     */
    void predictFromSMILESBatch(
        const std::vector<std::string>& smiles_list,
        std::vector<double>& results,
        int numThreads = 0
    ) const;

private:
    // Feature extraction (matches Python implementation)
    void extractSMARTSFeatures(const RDKit::ROMol* mol, std::vector<double>& features) const;
    void extractRDKitFeatures(const RDKit::ROMol* mol, std::vector<double>& features) const;
    void extractOsmordredFeatures(const RDKit::ROMol* mol, std::vector<double>& features) const;
    void extractUnifiedFeatures(const RDKit::ROMol* mol, std::vector<double>& features) const;
    void preprocessFeatures(std::vector<double>& features) const;
    void selectFeatures(const std::vector<double>& all_features, std::vector<double>& selected) const;
    
    // SMARTS patterns (291)
    std::vector<RDKit::ROMol*> smarts_queries_;
    
    // Golden ratios (50)
    std::vector<std::pair<int, int>> golden_ratios_;
    
    // RDKit descriptor calculator
    RDKit::Descriptors::MoleculeDescriptorCalculator* desc_calc_;
};

